import React from 'react';

import './index.css';


import Header from "./Header";
import Shop from "./Shop";
// import All_Shop_Data from "./All_Shop_Data";


// function allshops(val){
//     return(
//         <Shop
//            shopimage={val.shopimage}
//            shopname={val.shopname}
//            shopaddress={val.shopaddress}

//         />
//     );
// }


function App(props){
return(
<>
<div className="grandmain">
 <Header></Header>
 {/* <Shop></Shop>
 {/* <Shop></Shop> */}
 <Shop
     shopname="everyone"
     shopaddress='props.shopaddress'


            q_start1="checked"
            q_start2="checked"
            q_start3="checked"
            q_start4={props.q_start4}
            q_start5={props.q_start5}

            p_start1={props.p_start1}
            p_start2={props.p_start2}
            p_start3={props.p_start3}
            p_start4={props.p_start4}
            p_start5={props.p_start5}   
 />
 <Shop shopname="everyonedgtjh"></Shop> 

 {/* {All_Shop_Data.map(allshops)} */}

 </div>


</>
);
}

export default App;
